import React from 'react'
import { BrowserRouter, Routes, Route } from "react-router-dom";
import LogIn from '../components/LogIn';
import SignUp from '../components/signUp/SignUp'
export default function Rounting() {
    return ( <
        div >
        <
        BrowserRouter >
        <
        Routes >
        <
        Route path = "logIn"
        element = { < LogIn / > }
        /> <
        Route path = "signUp/*"
        element = { < SignUp / > }
        /> < /
        Routes > <
        /BrowserRouter> < /
        div >
    )
}
